import React, {Component} from "react";
import axios from "axios";
import Select2 from 'react-select2';
import './assets/css/select2.css';
class Ciudades extends Component{
    state ={
        ciudades: []
    }
    componentDidMount(){
        axios.get('https://raw.githubusercontent.com/diego-alvarado-escobar/proyectoclima/main/ciudadescolombia.json')
        .then((response)=>{
            this.setState({ciudades: response.data})
        })
        .catch((error) => {
            console.log(error);
        })
    }

    render(){
        return (
            <div className="ciudades">
                <div className="form-group">
                {console.log(this.state.ciudades)}
                <Select2
                    defaultValue={2} // or as string | array
                    data={this.state.ciudades}
                        
                    options={{
                        placeholder: 'search by tags',
                    }}
                    />
                </div>
            </div>

        );
    }
}

export default Ciudades;
